import { Link } from 'react-router-dom';
import { WelcomeLayout, WelcomeContent } from './Welcome.styles'; 

const Welcome = () => 
<WelcomeLayout>

<WelcomeContent>
<h1>Calculadora de pressupostos</h1>

<h6>En aquesta pàgina podràs calcular el pressupost del teu projecte web de forma còmoda i fàcil. 

Només has de seleccionar els serveis necessaris i, en el cas que es tracti d'una pàgina web, hauràs d'indicar també el nombre de pàgines i d'idiomes que desitges.</h6>

<Link to="/pressupost"><button type='button'>Calcula el pressupost</button></Link>
</WelcomeContent>
</WelcomeLayout>

;

export default Welcome;
